import React from 'react';
import {BrowserRouter as Router, Switch,  Route, Link } from "react-router-dom";
import Home from './Home';
import About from './About';
import Courses from './Courses';
 const Navigation = () =>{
   return(
     <Router>
         <ul className="menu">
           <li className="menu-items"><Home to="/"/>Home</li>
           <li className="menu-items"><Courses to="/courses"/>Courses</li>
           <li className="menu-items"><About to="/about"/>About</li>
         </ul>
     </Router>
   )
 }
export default Navigation;
